import React, { Fragment } from "react";
import styled from "styled-components";

const Table = styled.table`
    width: 100px;
    height: 100px;
    display: table;
    font-family: Calibri;
  `;


const TableContainer = (columns) => {
    return (
        <Table>
            <tbody>
                <tr>
                    <td>Payment Id</td>
                    <td>Payment Id</td>
                </tr>
            </tbody>
        </Table>
    );
};

export default TableContainer;
